          ingredientTextPlaceholder={props.ingredientTextPlaceholder}
          ingredientTextName={props.ingredientTextName}
          ingredientTextValue={props.ingredientTextValue}
          handleChange={(e) => props.handleChange(e)}
        />
        <RecipeIngredientPercent />

        <div className="recipe-ingredient-container__calc-weight-div">
          <p className="recipe-ingredient-container__calc-weight-value">G</p>
        </div>
        <button className="recipe__button_delete">-</button>
      </div>
      <button>Add</button>
    </>
  );
}

export default RecipeIngredientContainer;
